import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Bots() {
  const [bots, setBots] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/bots')
      .then(response => {
        setBots(response.data);
      })
      .catch(error => {
        console.error("Error fetching bots:", error);
      });
  }, []);

  return (
    <div>
      <h2>Existing Bots</h2>
      <ul>
        {bots.map(bot => (
          <li key={bot.id}>
            <strong>{bot.bot_name}</strong> - {bot.trade_type}
            {/* In a complete version, add options to edit/update bots */}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Bots;
